      type: System.String
      description: The FoundationaLLM instance identifier.
    - id: createAgentRequest
      type: FoundationaLLM.Common.Models.ResourceProviders.Agent.AgentTemplates.AgentCreationFromTemplateRequest
      description: The request object containing the parameter values for creating the agent.
    - id: rawAgentTemplateFiles
      type: System.Collections.Generic.Dictionary{System.String,System.String}
    - id: userIdentity
      type: FoundationaLLM.Common.Models.Authentication.UnifiedUserIdentity
      description: The identity of the user requesting to create the agent.
    return:
      type: System.Threading.Tasks.Task{FoundationaLLM.Common.Models.ResourceProviders.ResourceProviderUpsertResult}
